import React from "react";

class Ninjas extends React.Component{
    render(){
        //console.log(this.props)
        const {ninja} = this.props;
        console.log(ninja)
        return(
            <div>
                <h1>Hello {this.ninja.name} , {this.ninja.age},{this.ninja.belt}</h1>
            </div>
        )
    }
}

export default Ninjas;
